const BookList = ({ books }) => {
	return (
		<table className="book-list">
      <tbody>
        <tr>
    			{books.map((book) => (
    				<td>
              <img className="book-cover" src={book.image}/>
      				<p>{book.title}</p>
              <p>by {book.author}</p>
      				<p>{book.rating}</p>
            </td>
    			))}
        </tr>
      </tbody>
		</table>
	);
};

export default BookList;
